import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AddWatchImage = () => {
    const [watchData, setWatchData] = useState({
        watch_name: '',
        watch_thumbnail: '',
        brands: '',
        price: '',
        discount: '',
        watch_details: '',
        gender: '',
        dial_type: '',
        dial_colour: '',
        dial_shape: '',
        style: '',
        strap_material: ''
    });
    const navigate = useNavigate();
    const swal = require('sweetalert2')


    const handleChange = (e) => {
        const { name, value } = e.target;
        console.log(value);
        setWatchData({ ...watchData, [name]: value });
    };

    const handleFileChange = (e) => {
        const file = e.target.files[0];
        console.log(file);
        setWatchData({ ...watchData, watch_thumbnail: file });
    };
    
   

    const createWatch = async (watch) => {
        const formData = new FormData();
        for (let key in watch) {
          formData.append(key, watch[key]);
        }
        try {
          const response = await axios.post('http://127.0.0.1:8000/dashboard/watches/create/', formData, {
            headers: {
              'Content-Type': 'multipart/form-data'
            }
          });
          console.log('Watch added successfully:', response.data);
          navigate('/watch');
          swal.fire({
            title: "Watch Added",
            icon: "success",
            toast: true,
            timer: 6000,
            position: 'top-right',
            timerProgressBar: true,
            showConfirmButton: false
        })
        } catch (error) {
          console.error('Error adding watch:', error);
        }
      };
      
      const handleSubmit = async (e) => {
        e.preventDefault();
        const formData = new FormData();
        for (let key in watchData) {
          console.log(key);
          formData.append(key, watchData[key]);
          console.log(watchData); 
        }
        try {
          const response = await createWatch(watchData);
        } catch (error) {
          console.error('Error adding watch:', error);
        }
      };

    return (
        <div className="main-content">

        <div className="page-content">
            <div className="container-fluid">

                <div className="row">
                    <div className="col-12">
                        <div className="page-title-box d-sm-flex align-items-center justify-content-between">
                            <h4 className="mb-sm-0 font-size-18">Add watch</h4>
                        </div>
                    </div>
                </div>

        <div className="row">
            <div className="col-12">
                <div className="card">
                    <div className="card-body">
                        <form onSubmit={handleSubmit}>

                            <div className="mb-3 row">
                                <label htmlFor="watch_thumbnail" className="col-md-2 col-form-label">watch_thumbnail</label>
                                <div className="col-md-6">
                                    <input
                                        type="file"
                                        className="form-control"
                                        id="watch_thumbnail"
                                        name="watch_thumbnail"
                                        onChange={handleFileChange}
                                    />
                                </div>
                            </div>
                            <button type="submit" className="btn btn-primary">Submit</button>
                        </form>
                    </div>
                </div>
            </div>
        </div>
                    </div> 
                </div>

                
                <footer className="footer">
                    <div className="container-fluid">
                        <div className="row">
                            <div className="col-sm-6">
                                <script>document.write(new Date().getFullYear())</script> Â© React Dashboard.
                            </div>
                            <div className="col-sm-6">
                                <div className="text-sm-end d-none d-sm-block">
                                    Design & Develop by Sarfas
                                </div>
                            </div>
                        </div>
                    </div>
                </footer>
            </div>

    );
};

export default AddWatchImage;
